function tpstlishList(e){let t=e.querySelectorAll(".tpgb-stylist-list");t&&t.forEach(e=>{let s=e.querySelectorAll(".tpgb-icon-list-item");if(e.classList.contains("hover-inverse-effect")){let t=e.querySelector(".tpgb-icon-list-items");s.forEach(e=>{e.addEventListener("mouseenter",()=>{t.classList.add("on-hover")}),e.addEventListener("mouseleave",()=>{t.classList.remove("on-hover")})})}})}document.addEventListener("DOMContentLoaded",()=>{tpstlishList(document)});